function get_pinyin_array($string){
	global $pinyin_table;
	
	$flow = array();
	for ($i=0;$i<strlen($string);$i++){
		if (ord($string[$i]) >= 0x81 and ord($string[$i]) <= 0xfe){
			$h = ord($string[$i]);
			if (isset($string[$i+1])){
				$i++;
				$l = ord($string[$i]);
				if (isset($pinyin_table[$h][$l])){
					array_push($flow,$pinyin_table[$h][$l]);
				}
				else{
					array_push($flow,$h);
					array_push($flow,$l);
				}
			}
			else{
				array_push($flow,ord($string[$i]));
			}
		}
		else{
			array_push($flow,ord($string[$i]));
		}
	}
	
	$r = array();
	$flow_array_count = 0;
	while(isset($flow[$flow_array_count])){
		array_push($r,$flow[$flow_array_count][0]);
		++$flow_array_count;
	}
	
	return implode('',$r);
}
